/*----------------------------------------------------------------------
 *
 * SET: irreversible commit
 *
 *---------------------------------------------------------------------*/
/**
 * @internal
 * commit irreversible actions
 */
int _mfd_tpClient4SeverityTable_irreversible_commit(netsnmp_mib_handler *handler, netsnmp_handler_registration *reginfo,
		netsnmp_agent_request_info *agtreq_info, netsnmp_request_info *requests)
{
	tpClient4SeverityTable_rowreq_ctx *rowreq_ctx = (tpClient4SeverityTable_rowreq_ctx*) netsnmp_container_table_row_extract(requests);

	DEBUGMSGTL(("internal:tpClient4SeverityTable:_mfd_tpClient4SeverityTable_irreversible:commit","called\n"));

	netsnmp_assert(NULL != rowreq_ctx);

	/*
	 * check for and handle row creation/deletion
	 * and update column exist flags...
	 */
	if (rowreq_ctx->rowreq_flags & MFD_ROW_DELETED)
	{
		if (!(rowreq_ctx->rowreq_flags & MFD_ROW_CREATED))
			CONTAINER_REMOVE(tpClient4SeverityTable_if_ctx.container, rowreq_ctx);
	}
	else
	{
		if (rowreq_ctx->column_set_flags)
		{
			rowreq_ctx->column_set_flags = 0;
		}
	}

	return SNMP_ERR_NOERROR;
} /* _mfd_tpClient4SeverityTable_irreversible_commit */

/***********************************************************************
 *
 * DATA ACCESS
 *
 ***********************************************************************/
static void _container_free(netsnmp_container *container);

/**
 * @internal
 */
static int _cache_load(netsnmp_cache *cache, void *vmagic)
{
	DEBUGMSGTL(("internal:tpClient4SeverityTable:_cache_load","called\n"));

	if ((NULL == cache) || (NULL == cache->magic))
	{
		snmp_log(LOG_ERR, "invalid cache for tpClient4SeverityTable_cache_load\n");
		return -1;
	}

	/** should only be called for an invalid or expired cache */
	netsnmp_assert((0 == cache->valid) || (1 == cache->expired));

	/*
	 * call user code
	 */
	return tpClient4SeverityTable_container_load((netsnmp_container*) cache->magic);
} /* _cache_load */

/**
 * @internal
 */
static void _cache_free(netsnmp_cache *cache, void *magic)
{
	netsnmp_container *container;

	DEBUGMSGTL(("internal:tpClient4SeverityTable:_cache_free","called\n"));

	if ((NULL == cache) || (NULL == cache->magic))
	{
		snmp_log(LOG_ERR, "invalid cache in tpClient4SeverityTable_cache_free\n");
		return;
	}

	container = (netsnmp_container*) cache->magic;

	_container_free(container);
} /* _cache_free */

/**
 * @internal
 */
static void _container_item_free(tpClient4SeverityTable_rowreq_ctx *rowreq_ctx, void *context)
{
	DEBUGMSGTL(("internal:tpClient4SeverityTable:_container_item_free","called\n"));

	if (NULL == rowreq_ctx)
		return;

	tpClient4SeverityTable_release_rowreq_ctx(rowreq_ctx);
} /* _container_item_free */

/**
 * @internal
 */
static void _container_free(netsnmp_container *container)
{
	DEBUGMSGTL(("internal:tpClient4SeverityTable:_container_free","called\n"));

	if (NULL == container)
	{
		snmp_log(LOG_ERR, "invalid container in tpClient4SeverityTable_container_free\n");
		return;
	}

	/*
	 * call user code
	 */
	tpClient4SeverityTable_container_free(container);

	/*
	 * free all items. inefficient, but easy.
	 */
	CONTAINER_CLEAR(container, (netsnmp_container_obj_func *) _container_item_free, NULL);
} /* _container_free */

/**
 * @internal
 * initialize the container with functions or wrappers
 */
void _tpClient4SeverityTable_container_init(tpClient4SeverityTable_interface_ctx *if_ctx)
{
	DEBUGMSGTL(("internal:tpClient4SeverityTable:_tpClient4SeverityTable_container_init","called\n"));

	/*
	 * cache init
	 */
	if_ctx->cache = netsnmp_cache_create(30, /* timeout in seconds */
	_cache_load, _cache_free, tpClient4SeverityTable_oid, tpClient4SeverityTable_oid_size);

	if (NULL == if_ctx->cache)
	{
		snmp_log(LOG_ERR, "error creating cache for tpClient4SeverityTable\n");
		return;
	}

	if_ctx->cache->flags = NETSNMP_CACHE_DONT_INVALIDATE_ON_SET;

	tpClient4SeverityTable_container_init(&if_ctx->container, if_ctx->cache);
	if (NULL == if_ctx->container)
		if_ctx->container = netsnmp_container_find("tpClient4SeverityTable:table_container");
	if (NULL == if_ctx->container)
	{
		snmp_log(LOG_ERR, "error creating container in "
				"tpClient4SeverityTable_container_init\n");
		return;
	}

	if (NULL != if_ctx->cache)
		if_ctx->cache->magic = (void*) if_ctx->container;
} /* _tpClient4SeverityTable_container_init */

/**
 * @internal
 * shutdown the container with functions or wrappers
 */
void _tpClient4SeverityTable_container_shutdown(tpClient4SeverityTable_interface_ctx *if_ctx)
{
	DEBUGMSGTL(("internal:tpClient4SeverityTable:_tpClient4SeverityTable_container_shutdown","called\n"));

	tpClient4SeverityTable_container_shutdown(if_ctx->container);

	_container_free(if_ctx->container);

} /* _tpClient4SeverityTable_container_shutdown */

tpClient4SeverityTable_rowreq_ctx *
tpClient4SeverityTable_row_find_by_mib_index(tpClient4SeverityTable_mib_index *mib_idx)
{
	tpClient4SeverityTable_rowreq_ctx *rowreq_ctx;
	oid oid_tmp[MAX_OID_LEN];
	netsnmp_index oid_idx;
	int rc;

	/*
	 * set up storage for OID
	 */
	oid_idx.oids = oid_tmp;
	oid_idx.len = sizeof(oid_tmp) / sizeof(oid);

	/*
	 * convert
	 */
	rc = tpClient4SeverityTable_index_to_oid(&oid_idx, mib_idx);
	if (MFD_SUCCESS != rc)
		return NULL;

	rowreq_ctx = (tpClient4SeverityTable_rowreq_ctx*) CONTAINER_FIND(tpClient4SeverityTable_if_ctx.container, &oid_idx);

	return rowreq_ctx;
}

